import React from 'react';
import PropTypes from 'prop-types';
import {Link} from 'react-router-dom';
categories.propTypes = {
    data: PropTypes.array.isRequired
}
export default function categories(props) {
    return (
        <div className='mb-3 col-12 col-sm-3'>
            <p className='fs-4'>Categories</p>
            <form>
                <input className='form-control'/>
                <button className='mt-3 mb-3 btn btn-primary'>Add new</button>
            </form>
            <Link style={{ color: '#4a50c0'}} className='text-decoration-none d-block ' to='/post'>All</Link>
            {

                props.data.map((value,key)=>{
                    return <Link  style={{ color: '#4a50c0'}} className='text-decoration-none d-block' to={'?Idcategory='+value._id} key={key}>{value.title}</Link>
                }) 
            }
        </div>
    )
}
